    false,nt"url": null,nt"notes": "This data set contains Continental Shelf
    Boundary (CSB) lines in ESRI Arc/Info export and Arc/View shape file formats for
    the BOEM Pacific Region. The CSB defines the seaward limit of federally managed
    OCS lands. This CSB file only includes the lateral boundaries between the United
    States and Canada or Mexico. That portion of the CSB defined by the 200 nautical
    mile line has not yet been calculated. Because GIS projection and topology functions
    can change or generalize coordinates, these GIS files are NOT an OFFICIAL record
    for the exact CSB.",nt"license_title": null,nt"extras": [{ntt"key":
